import React, { Component } from 'react';
class Counter extends Component {
    state = {
        count : 10
    };

    render() { 
        return (
            <React.Fragment>
                <span>{this.functionTest()}</span>
            </React.Fragment>
        );
    };
    functionTest() {
         return this.state.count === 0 ? 'Zero' : 1;
    };
};

 
export default Counter;
